ription\": \"Our goal is to address the lack of information on activity levels, particularly among young children, and the limitations of current questionnaires that neglect certain types of physical activity. By collecting data on active play, we can compare activity levels within and between countries to identify effective strategies for promoting physical activity. Our study involves expert and public reviews, translations, pilot studies, and a large-scale data collection across diverse urban and rural areas. By comparing our questionnaire data with movement sensors, we aim to create a more accurate global measurement of physical activity, contributing to healthier lifestyles worldwide.\", \"languages_id\": {\"id\": 4}}',1073),(1072,1161,'pages_translations','5','{\"heading\": \"gacpaq\", \"pages_id\": 2, \"button_text\": \"Seguir\", \"description\": \"Nuestro objetivo es abordar la falta de información sobre los niveles de actividad, especialmente entre los niños pequeños, y las limitaciones de los cuestionarios actuales que descuidan ciertos tipos de actividad física. Al recopilar datos sobre el juego activo, podemos comparar los niveles de actividad dentro y entre países para identificar estrategias efectivas para promover la actividad física. Nuestro estudio involucra revisiones de expertos y del público, traducciones, estudios piloto y una amplia recopilación de datos en diversas áreas urbanas y rurales. Al comparar nuestros datos del cuestionario con sensores de movimiento, aspiramos a crear una medición global más precisa de la actividad física, contribuyendo a estilos de vida más saludables en todo el mundo.\", \"languages_id\": {\"id\": 2}}','{\"heading\": \"gacpaq\", \"pages_id\": 2, \"button_text\": \"Seguir\", \"description\": \"Nuestro objetivo es abordar la falta de información sobre los niveles de actividad, especialmente entre los niños pequeños, y las limitaciones de los cuestionarios actuales que descuidan ciertos tipos de actividad física. Al r