envenido!\", \"pages_id\": 1, \"button_text\": \"¡Empecemos!\", \"description\": \"La actividad física es esencial para el desarrollo saludable de los niños, sin embargo, el 80% de los jóvenes no son lo suficientemente activos y carecemos de información sobre los niveles de actividad de los niños pequeños.\", \"languages_id\": 2}','{\"pages_id\": 1, \"button_text\": \"¡Empecemos!\", \"languages_id\": 2}',NULL),(1076,1165,'pages_translations','3','{\"id\": 3, \"heading\": \"Bienvenue !\", \"pages_id\": 1, \"button_text\": \"Commençons!\", \"description\": \"L\'activité physique est essentielle pour le développement sain de l\'enfant, pourtant 80 % des jeunes ne sont pas assez actifs et nous manquons d\'informations sur les niveaux d\'activité des jeunes enfants.\", \"languages_id\": 3}','{\"pages_id\": 1, \"button_text\": \"Commençons!\", \"languages_id\": 3}',NULL),(1077,1167,'introductory_pages_pages','1','{\"id\": 1, \"item\": \"1\", \"collection\": \"pages\", \"introductory_pages_id\": 1}','{\"item\": 1, \"collection\": \"pages\", \"introductory_pages_id\": 1}',NULL),(1078,1169,'pages_translations','6','{\"heading\": \"gacpaq\", \"pages_id\": 2, \"button_text\": \"Continuer\", \"description\": \"Notre objectif est de remédier au manque d\'informations sur les niveaux d\'activité, notamment chez les jeunes enfants, ainsi que les limites des questionnaires actuels qui négligent certains types d\'activité physique. En collectant des données sur le jeu actif, nous pouvons comparer les niveaux d\'activité au sein des différents pays pour identifier des stratégies efficaces de promotion de l\'activité physique. Notre étude comprend des évaluations d\'experts et du public, des traductions, des études pilotes et une collecte de données à grande échelle dans diverses zones urbaines et rurales. En comparant nos données de questionnaire avec des capteurs de mouvement, nous visons à créer une mesure mondiale plus précise de l\'activité physique, contribuant ainsi à des modes de vie plus sains à l\'échelle mondiale.\", \"languages_id\": {\"id\": 3}}','{\"heading\": \"gacpaq\", \"pages_id\": 2, \"button_text\": \"Continuer\", \"description\": \"Notre objectif est de remédier au manque d\'informations sur les niveaux d\'activité, notamment chez les jeunes enfants, ainsi que les limites des questionnaires actuels qui négligent certains types d\'activité physique. En collectant des données sur le jeu actif, nous pouvons comparer les niveaux d\'activité au sein des différents pays pour identifier des stratégies efficaces de promotion de l\'activité physique. Notre étude comprend des évaluations d\'experts et du public, des traductions, des études pilotes et une collecte de données à grande échelle dans diverses zones urbaines et rurales. En comparant nos données de questionnaire avec des capteurs de mouvement, nous visons à créer une mesure mondiale plus précise de l\'activité physique, contribuant ainsi à des modes de vie plus sains à l\'échelle mondiale.\", \"languages_id\": {\"id\": 3}}',NULL),(1079,1171,'introductory_pages_pages','2','{\"id\": 2, \"item\": \"2\", \"collection\": \"pages\", \"introductory_pages_id\": 1}','{\"item\": 2, \"collection\": \"pages\", \"introductory_pages_id\": 1}',NULL),(1080,1173,'regions','1','{\"code\": \"US\", \"title\": \"United States\"}','{\"code\": \"US\", \"title\": \"United States\"}',NULL),(1081,1174,'regions','2','{\"code\": \"CA\", \"title\": \"Canada\"}','{\"code\": \"CA\", \"title\": \"Canada\"}',NULL),(1082,1175,'regions','3','{\"code\": \"MX\", \"title\": \"Mexico\"}','{\"code\": \"MX\", \"title\": \"Mexico\"}',NULL),(1083,1176,'regions','4','{\"code\": \"JP\", \"title\": \"Japan\"}','{\"code\": \"JP\", \"title\": \"Japan\"}',NULL),(1084,1177,'pages_translations','7','{\"heading\": \"Great Job\", \"pages_id\": 3, \"button_text\": \"Let\'s get started\", \"languages_id\": {\"id\": 4}}','{\"heading\": \"Great Job\", \"pages_id\": 3, \"button_text\": \"Let\'s get started\", \"languages_id\": {\"i