INSERT INTO `pages_translations` VALUES (1,1,4,'Welcome!','Let\'s get started','Physical activity is essential for healthy child development, yet 80% of youth are not active enough and we lack information about activity levels of young children.'),(2,1,2,'¡Bienvenido!','¡Empecemos!','La actividad física es esencial para el desarrollo saludable de los niños, sin embargo, el 80% de los jóvenes no son lo suficientemente activos y carecemos de información sobre los niveles de actividad de los niños pequeños.'),(3,1,3,'Bienvenue !','Commençons!','L\'activité physique est essentielle pour le développement sain de l\'enfant, pourtant 80 % des jeunes ne sont pas assez actifs et nous manquons d\'informations sur les niveaux d\'activité des jeunes enfants.'),(4,2,4,'gacpaq','Continue','Our goal is to address the lack of information on activity levels, particularly among young children, and the limitations of current questionnaires that neglect certain types of physical activity. By collecting data on active play, we can compare activity levels within and between countries to identify effective strategies for promoting physical activity. Our study involves expert and public reviews, translations, pilot studies, and a large-scale data collection across diverse urban and rural areas. By comparing our questionnaire data with movement sensors, we aim to create a more accurate global measurement of physical activity, contributing to healthier lifestyles worldwide.'),(5,2,2,'gacpaq','Seguir','Nuestro objetivo es abordar la falta de información sobre los niveles de actividad, especialmente entre los niños pequeños, y las limitaciones de los cuestionarios actuales que descuidan ciertos tipos de actividad física. Al recopilar datos sobre el juego activo, podemos comparar los niveles de actividad dentro y entre países para identificar estrategias efectivas para promover la actividad física. Nuestro estudio involucra revisiones de expertos y del público, traducciones, estudios piloto y una amplia recopilación de datos en diversas áreas urbanas y rurales. Al comparar nuestros datos del cuestionario con sensores de movimiento, aspiramos a crear una medición global más precisa de la actividad física, contribuyendo a estilos de vida más saludables en todo el mundo.'),(6,2,3,'gacpaq','Continuer','Notre objectif est de remédier au manque d\'informations sur les niveaux d\'activité, notamment chez les jeunes enfants, ainsi que les limites des questionnaires actuels qui négligent certains types d\'activité physique. En collectant des données sur le jeu actif, nous pouvons comparer les niveaux d\'activité au sein des différents pays pour identifier des stratégies efficaces de promotion de l\'activité physique. Notre étude comprend des évaluations d\'experts et du public, des traductions, des études pilotes et une collecte de données à grande échelle dans diverses zones urbaines et rurales. En comparant nos données de questionnaire avec des capteurs de mouvement, nous visons à créer une mesure mondiale plus précise de l\'activité physique, contribuant ainsi à des modes de vie plus sains à l\'échelle mondiale.'),(7,3,4,'Great Job','Let\'s get started',NULL),(8,3,2,' ¡Excelente trabajo!','¡Comencemos!',NULL),(9,3,3,'Excellent travail','Commençons!',NULL);
/*!40000 ALTER TABLE `pages_translations` ENABLE KEYS */;
UNLOCK TABLES;

